import { Box, Typography } from "@mui/material";
import colors from "../utils/colors";
import QualityIcon from "../widgets/QualityIcon";
import BoltOutlinedIcon from '@mui/icons-material/BoltOutlined';
import IcecreamOutlinedIcon from '@mui/icons-material/IcecreamOutlined';
import DeviceThermostatOutlinedIcon from '@mui/icons-material/DeviceThermostatOutlined';

const Qualities = ({mediaQuery, t}) => {

    return(
        <Box
            width="100%"
            display="flex"
            backgroundColor="lightblue"
            margin="1rem"
            sx={{padding: (mediaQuery ? '1.5rem' : '1rem')}}
            border="1px solid black"
            justifyContent="center"
        >
            <Box
                width="90%"
                backgroundColor="lightgreen"
                padding="1rem"
                border="1px solid black"
                display="flex"
                justifyContent="space-around"
                alignItems="flex-start"
                flexWrap="wrap"
            >
                <QualityIcon quality={t('fastDelivery')} ico={<BoltOutlinedIcon sx={{fontSize: "40px", m: "0.5rem"}}></BoltOutlinedIcon>}></QualityIcon>
                <QualityIcon quality={t('flavorVariety')} ico={<IcecreamOutlinedIcon sx={{fontSize: "40px", m: "0.5rem"}}></IcecreamOutlinedIcon>}></QualityIcon>
                <QualityIcon quality={t('freshIngridients')} ico={<DeviceThermostatOutlinedIcon sx={{fontSize: "40px", m: "0.5rem"}}></DeviceThermostatOutlinedIcon>}></QualityIcon>

            </Box>
        </Box>
    )
}

export default Qualities;
